.search-bar {
  display: flex;  
  padding: 10px;
  background: #f4f4f4;
  .input-wrap {
    flex: 1;
    position: relative;
    border-radius: 3px;
    background: #fff;
    padding: 8px 12px 8px 35px;
  }
  input {
    flex: 1;
    outline: 0;
    height: 20px;
    line-height: 20px;
    width: 100%;
    color: rgba(0,0,0,.3);
    border: none;
    display: block;
    -webkit-appearance: none;
    font-size: 14px;
  }
  ::-webkit-input-placeholder {
    color: #ccc;
  }
  .icon-search {
    position: absolute;
    top: 9px;
    left: 10px;
    width: 18px;
    height: 18px;
    z-index: 999;
    // background-image: url(data:image/png;base64,);
    // background-repeat: no-repeat;
    background-size: cover;
    text-indent: -999px;
  }
}

.search-results {
  .song-item {
    position: relative;
    height: 55px;
    padding-left: 56px;
    overflow: hidden;
    background: #fff;
    border-bottom: 1px solid #ddd;
  }
  .song-name {
    margin: 10px 0 2px;
    line-height: 18px;
    font-size: 16px;
    font-weight: normal;
    color: #000;
  }
  .song-artist {
    color: #808080;
    font-size: 12px;
  }
  .icon-music {
    top: 18px;
    left: 18px;
    width: 22px;
    height: 20px;
    position: absolute;
    background-position: 0 0;
    background-size: 22px 30px;
    background-repeat: no-repeat;
    background-image: url(../images/search.png);
  }
}

.search-loading {
  height: 55px;
  text-align: center;
  position: relative;
  display: none;
  align-items: center;
  justify-content: center;
  &.show { display: flex; }
  .loading-icon {
    top: -2px;
    width: 20px;
    height: 20px;
    position: relative;
    display: inline-block;
    vertical-align: middle;
    background-size: 20px 20px;
    background-image: url('../images/icon_loading.png');
    animation: loading 1s infinite;
  }
  .loading-text {
    margin-left: 5px;
  }
  .loading-done, .loading-text {
    color: #808080;
    font-size: 12px;
  }
}

@keyframes loading {
  from { transform: rotate(0deg) }
  8.32% { transform: rotate(0deg) }
  8.33% { transform: rotate(30deg) }
  16.65% { transform: rotate(30deg) }
